const styles = (theme) => ({
  dialog: {
    marginRight: theme.mixins.drawer.default.width / 2,
  },
  dialogExpanded: {
    marginRight: theme.mixins.drawer.expanded.width,

    [theme.breakpoints.down('md')]: {
      marginRight: theme.mixins.drawer.expanded.minWidth,
    },
  },
  title: {
    marginBottom: 0,
  },
  subtitle: {
    marginBottom: 0,
  },
  close: {
    position: 'absolute',
    top: 11,
    right: 11,
  },
  content: {
    display: 'flex',
    flexDirection: 'column',
    overflow: 'auto',
  },
  container: {
    flex: 1,
    display: 'flex',
    marginTop: 0,
    minHeight: 150,
    overflowY: 'hidden',
    flexDirection: 'column',
  },
});

export default styles;
